import styled from 'styled-components';

export const ReleaseStyled = styled.div`
  width: 70%;
  display: flex;
  flex-direction: column;
  padding: 0px 30px 0px 30px;

  h1 {
    text-align: left;
  }

  h2 {
    text-align: left;
  }

  h3 {
    text-align: left;
  }

  div {
    min-height: 100%;
    min-width: 100%;
    max-height: 400px;
    max-width: 400px;
    height: auto;
    width: auto;
    margin: 0 auto;
  }
  img {
    height: 100%;
    width: 100%;
    display: block
  }
`;
